import React from 'react';
// import logo from './logo.svg';
import './App.css';
import Header from './components/Header';




class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      IsLogin: false,
    }
  }

  render() {
    if (this.state.IsLogin === false) return <Header />
  }
}


export default App;
